import numpy as np

# Laplace Mechanism
def laplace_mechanism(data, epsilon):
    # Generate and add Laplace noise
    noise = np.random.laplace(0, epsilon, data.shape)
    noisy_data = data + noise
    return noisy_data

# # Weighted Laplace Mechanism
# def weighted_laplace_mechanism(data, epsilon, weighted_epsilon, important_features):
#     # Generate and apply weighted epsilon to important features
#     noise = np.random.laplace(0, epsilon, data.shape)
#     noise[:, important_features] = noise[:, important_features] + weighted_epsilon
#     noisy_data = data + noise
#     return noisy_data

def weighted_laplace_mechanism(data, epsilon, weighted_epsilon, important_features):
    noise = np.zeros_like(data)
    general_noise = np.random.laplace(0, epsilon, data.shape)
    specific_noise = np.random.laplace(0, weighted_epsilon, (data.shape[0], len(important_features)))
    
    # Apply general noise to all data
    noisy_data = data + general_noise
    
    # Apply specific noise to important features
    for i, feature_index in enumerate(important_features):
        noisy_data[:, feature_index] += specific_noise[:, i]
    return noisy_data

